function UserList({ users }) {
  // if (!users.length) return null;

  const renderedUsers = users.map(({ name, email }, i) => {
    return (
      <tr key={`table-row-${i}`}>
        <td>{name}</td>
        <td>{email}</td>
      </tr>
    );
  });
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email</th>
        </tr>
      </thead>
      <tbody data-testid='users-table-body'>{renderedUsers}</tbody>
    </table>
  );
}

export default UserList;
